import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return (
      <body id='wrapper'>
        <div id='quote-box'>
          <div id='quote-text'>
            <span id='text'>QUOTE GOES HERE</span>
          </div>
          <span>-</span>
          <span id='author'>Author </span>
          <div id='buttons'>
            <button id='tweet'></button>
            <button id='new-quote'></button>
          </div>
        </div>
      </body>
    );
  }
}

export default App;
